import React from 'react'
import api from '../../api'
import Navbar from '../../components/navbar'

export default function Home() {

  api.get("/authenticate")
  .then(res=>{
    console.log(res.data);
  })
  .catch(err=>{
    console.log(err)
  })

  onload();

  return (
    <Navbar />
  )
}
